            columnNumber: 13
          }, this), /*#__PURE__*/_jsxDEV("p", {
            className: "Texto-3",
            children: "Autorizo en forma permanente a LAS ENTIDADES, o a quienes representen sus derechos u ostenten en el futuro la calidad de acreedor, cesionario, o cualquier calidad frente a mi o frente a la persona que represento, como titular de la informaci\xF3n, en adelante LAS ENTIDADES y en virtud de la Solicitud \xDAnica de Grupo, para que realicen los tratamientos que se indican a continuaci\xF3n, por considerarse necesarios e inherentes para el cumplimiento de la ley, el funcionamiento de la operaci\xF3n financiera, el ofrecimiento y administraci\xF3n de productos y/o servicios, entre otros: I. Autorizaciones necesarias para el desarrollo de la actividad de LAS ENTIDADES. LAS ENTIDADES est\xE1n autorizadas para que: (i) soliciten, almacenen, consulten, compartan, informen, reporten, rectifiquen, procesen, modifiquen, actualicen, aclaren, retiren o divulguen, ante operadores de informaci\xF3n, riesgo y de seguridad social y parafiscales, o ante cualquier otra entidad que maneje o administre bases de datos en Colombia y en el exterior, todo lo referente a mi informaci\xF3n financiera, comercial y crediticia y aquella relacionada con la liquidaci\xF3n o pago de aportes al sistema de seguridad social y parafiscales (presente, pasada y futura) o de mi representada, incluyendo mis datos biom\xE9tricos o de mi representada, y aquella relacionada con los derechos y obligaciones originados en virtud de cualquier contrato celebrado u operaci\xF3n que haya llegado o llegare a celebrar o realizar yo o la persona que represento, con cualquiera de LAS ENTIDADES. (ii) accedan, recolecten, procesen, actualicen, conserven, compartan y destruyan mi informaci\xF3n y documentaci\xF3n o la de la persona que represento, incluso cuando no se haya perfeccionado una relaci\xF3n contractual o despu\xE9s de finalizada la misma. (iii) suministren, consulten, verifiquen y compartan la informaci\xF3n financiera, comercial, crediticia m\xEDa o de mi representada y/o mis datos biom\xE9tricos o de mi representada, con contratistas o cualquier otra entidad nacional o extranjera que preste servicios de verificaci\xF3n o an\xE1lisis de administraci\xF3n de riesgo; y actualicen mi informaci\xF3n o la de mi representada, de acuerdo con el an\xE1lisis realizado. (iv) compilen y remitan a las autoridades competentes, incluyendo las fiscales y los reguladores financieros, nacionales o extranjeros, la informaci\xF3n relacionada con la titularidad de los productos y servicios contratados o que llegare a contratar yo y/o mi representada; datos de contacto, movimientos, saldos, y toda aquella informaci\xF3n m\xEDa y/o de mi representada que reposare en la entidad que sea solicitada por las normas nacionales o extranjeras. (v) consulten multas y sanciones a mi cargo o a cargo de mi representada ante las diferentes autoridades administrativas y judiciales. (vi) consulten, soliciten o verifiquen la informaci\xF3n sobre mis activos, bienes o derechos m\xEDos o de mi representada en entidades p\xFAblicas o privadas, o que conozcan personas naturales o jur\xEDdicas, o que se encuentren en buscadores p\xFAblicos, redes sociales o publicaciones f\xEDsicas o electr\xF3nicas, bien fuere en Colombia o en el exterior. (vii) Compartan, transmitan, transfieran y divulguen informaci\xF3n y documentaci\xF3n m\xEDa o de mi representada aqu\xED suministrada y cualquier informaci\xF3n necesaria y relacionada con el presente tr\xE1mite de financiaci\xF3n con las siguientes personas: la constructora del inmueble a financiar, la inmobiliaria, la fiduciaria que act\xFAe como vocera y administradora del Fideicomiso enajenante del inmueble, los abogados externos a cargo del estudio de t\xEDtulos del inmueble y la entidad titularizadora en caso de titularizaci\xF3n de mi cr\xE9dito o el de mi representada; (viii) Consulten, soliciten o verifiquen mi informaci\xF3n de ubicaci\xF3n o contacto o de mi representada en entidades p\xFAblicas o privadas. II. Autorizaciones por la naturaleza del producto y/o servicio. LAS ENTIDADES est\xE1n autorizadas para que: a nivel nacional e internacional compartan, transmitan, transfieran y divulguen mi informaci\xF3n y documentaci\xF3n y/o la de mi representada, siempre que por la naturaleza del producto o servicio adquirido se requiera este tratamiento, con las siguientes personas: (a) quienes ofrezcan, presten o suministren bienes y servicios a LAS ENTIDADES para la adecuada prestaci\xF3n de sus productos o servicios; o a quienes en alianza ofrezcan productos o servicios que conllevan beneficios para m\xED y/o para mi representada en virtud de productos que tengo con LAS ENTIDADES; o a las remesadoras con las cuales LAS ENTIDADES han celebrado convenios para la gesti\xF3n y entrega de recursos enviados del exterior; (b) entidades con las cuales tengan celebrados o celebren a futuro contratos de uso de red; (c) la(s) aseguradora(s) con la(s) cual(es) LAS ENTIDADES tengan contratadas p\xF3lizas o con las cuales yo y/o mi representada haya decidido contratarlas, los intermediarios de seguros o reaseguros; (d) el comercializador o proveedor de los bienes o servicios financiados por LAS ENTIDADES; (e) los terceros contratados por LAS ENTIDADES para la cobranza y/o que realizan investigaci\xF3n de bienes y derechos tanto m\xEDos como de mi representada; (f) las entidades que realizan pagos de subsidios o beneficios a mi favor y/o de mi representada; (g) los terceros contratados por LAS ENTIDADES o personas que en virtud de cualquier relaci\xF3n contractual con dichos terceros, llevan a cabo aval\xFAos; (h) las entidades operadoras de sistemas de pago de alto y bajo valor y dem\xE1s entidades nacionales o internacionales que participan en dichos sistemas; (i) las entidades de corresponsal\xEDa en el exterior y/o bancos corresponsales en virtud de las operaciones realizadas a trav\xE9s de, o con estas entidades; (j) las personas que est\xE9n interesadas en la adquisici\xF3n de cartera de LAS ENTIDADES o que la adquieran a cualquier t\xEDtulo; (k) las bolsas de valores, administradores de sistemas de negociaci\xF3n y registro, a los proveedores de precios, a los organismos de autorregulaci\xF3n, los dep\xF3sitos de valores, entidades que custodian valores y dem\xE1s proveedores de infraestructura del mercado de valores, para que recopilen, administren, intercambien informaci\xF3n entre ellos y la pongan en circulaci\xF3n en el mercado de valores; (l) las entidades de redescuento en virtud de las operaciones realizadas con las mismas; (m) a quienes son contratados para la realizaci\xF3n de actividades de educaci\xF3n financiera; (n) la entidad administradora del programa de lealtad de LAS ENTIDADES, para que me contacten o contacten a mi representada para ofrecer, vincular, promocionar, gestionar dicho programa, y los puntos y beneficios asociados a \xE9ste. III. Autorizaciones para fines comerciales, el ofrecimiento y administraci\xF3n de productos y/o servicios. LAS ENTIDADES est\xE1n autorizadas para que: i) Me contacten a m\xED o a mi representada v\xEDa telef\xF3nica, mensajer\xEDa instant\xE1nea directamente o a trav\xE9s de sus proveedores, me env\xEDen mensajes por cualquier medio, as\xED como correos electr\xF3nicos y redes sociales; ii) Compartan mi informaci\xF3n o la de mi representada con proveedores o aliados; iii) Consulten, soliciten o verifiquen mi informaci\xF3n de ubicaci\xF3n o contacto o la de mi representada en entidades p\xFAblicas o privadas, en Colombia o en el exterior. Los anteriores tratamientos, adem\xE1s de considerar las finalidades antes se\xF1aladas, tambi\xE9n consideran las siguientes: para que LAS ENTIDADES: (a) Conozcan mi comportamiento financiero, comercial y crediticio, y todo lo relacionado con la liquidaci\xF3n o pago de aportes al sistema de seguridad social y parafiscales, y el cumplimiento de mis obligaciones legales o de mi representada; (b) Realicen todas las gestiones necesarias tendientes a confirmar y actualizar la informaci\xF3n m\xEDa o de mi representada; (c) Validen y verifiquen mi identidad o la de mi representada para el ofrecimiento y administraci\xF3n de productos y servicios, as\xED mismo para que se compartan la informaci\xF3n; (d) Establezcan, mantengan, terminen una relaci\xF3n contractual y actualicen mi informaci\xF3n o la de mi representada; (e) Ofrezcan y presten sus productos o servicios a trav\xE9s de cualquier medio o canal para mi beneficio y el de mi representada y de acuerdo con el perfil de cada uno; (f) Realicen una adecuada prestaci\xF3n y administraci\xF3n de los servicios financieros, incluyendo la gesti\xF3n de cobranza; (g) Suministren informaci\xF3n comercial, legal, de productos, de seguridad, de servicio o de cualquier otra \xEDndole; (h) Conozcan mi ubicaci\xF3n y datos de contacto o los de mi representada para efectos de notificaciones con fines de seguridad y ofrecimiento de beneficios y ofertas comerciales; (i) Efect\xFAen an\xE1lisis e investigaciones comerciales, estad\xEDsticas, de riesgos, de mercado, interbancaria y financiera incluyendo contactarme o contactar a mi representada para estos fines. Revocatorias. Sin perjuicio de las autorizaciones que he otorgado a LAS ENTIDADES para el tratamiento de datos personales, declaro que conozco el derecho que me asiste para revocar en los t\xE9rminos que prev\xE9 la ley, cualquiera de las siguientes autorizaciones: (i) env\xEDo de mensajes de texto para ofertas comerciales; (ii) env\xEDo de correos electr\xF3nicos para ofertas comerciales; (iii) oferta comercial por televentas de productos que no poseo en LAS ENTIDADES; y (iv) compartir informaci\xF3n con terceros aliados para que estos ofrezcan sus productos, a trav\xE9s de los canales de LAS ENTIDADES."
