            className: "Texto-3",
            children: ["Antilavado y anticorrupci\xF3n. Nos obligamos con LAS ENTIDADES a implementar las medidas tendientes a evitar que sus operaciones puedan ser utilizadas como instrumentos para el ocultamiento, manejo, inversi\xF3n o aprovechamiento en cualquier forma de dinero u otros bienes provenientes de actividades il\xEDcitas o para dar apariencia de legalidad a estas actividades. En tal sentido, declaro (amos) conocer y aceptar (amos) que LAS ENTIDADES podr\xE1n dar por terminado de manera unilateral e inmediata la relaci\xF3n comercial existente, sin que haya lugar al pago de indemnizaci\xF3n alguna por parte de LAS ENTIDADES cuando, la sociedad, sus asociados directos e indirectos con una participaci\xF3n mayor o igual al 5% en el capital social, o sus directivos o agentes en condici\xF3n de tales, en cualquier tiempo hayan sido o llegaren a ser: i) condenado(s) por parte de las autoridades competentes por el delito de lavado de activos, los delitos fuente de \xE9ste, incluidos los delitos contra la administraci\xF3n p\xFAblica o el delito de financiaci\xF3n del terrorismo o administraci\xF3n de recursos relacionados con actividades terroristas; ii) sancionado(s) administrativamente por violaciones a cualquier norma anticorrupci\xF3n; iii) incluido(s) en listas administradas por cualquier autoridad nacional o extranjera para el control de lavado de activos y/o financiaci\xF3n del terrorismo y/o corrupci\xF3n en cualquiera de sus modalidades; iv) vinculado(s) a cualquier tipo de investigaci\xF3n, proceso judicial o administrativo, adelantado por las autoridades competentes del orden nacional o extranjero, por la presunta comisi\xF3n de delitos o infracciones relacionadas con el lavado de activos, delitos fuente de lavado de activos, incluidos delitos contra la administraci\xF3n p\xFAblica, y/o financiaci\xF3n del terrorismo o administraci\xF3n de recursos relacionados con actividades terroristas. Igualmente cuando llegare a incumplir la obligaci\xF3n de actualizaci\xF3n de informaci\xF3n establecida por la Entidad. Informaci\xF3n. Declaramos que: i) esta informaci\xF3n es cierta, puede ser utilizada para el proceso de actualizaci\xF3n y es verificable en cualquier momento y nos comprometemos a actualizarla o confirmarla al menos una vez al a\xF1o o cada vez que un producto o servicio lo amerite. Igualmente nos obligamos a informarles cualquier cambio relacionado con los datos de contacto, residencia fiscal, domicilio y actividad comercial, dentro de los 20 d\xEDas siguientes a la fecha en que se produjo el cambio. ii) para la actualizaci\xF3n solo diligenciamos la informaci\xF3n que ha cambiado en el \xFAltimo a\xF1o, en consecuencia la informaci\xF3n no diligenciada permanece vigente; iii) Conocemos que la presentaci\xF3n de esta solicitud no implica compromiso de LAS ENTIDADES para autorizar la vinculaci\xF3n y/ actualizaci\xF3n. iv) Aceptamos que cualquier inexactitud detectada, cancelar\xE1 el proceso de vinculaci\xF3n y/o actualizaci\xF3n solicitado; v) Autorizamos a LAS ENTIDADES la destrucci\xF3n de este formulario, de los documentos soportes de la solicitud en el evento de que el proceso vinculaci\xF3n y/o actualizaci\xF3n haya sido desfavorable. Producto, costos y tarifas. Declaro que he conocido las caracter\xEDsticas y condiciones de los productos o servicios para los cuales estoy solicitando la vinculaci\xF3n y/o actualizaci\xF3n, las cuales podr\xE9 consultar en las oficinas y en la p\xE1gina web de LAS ENTIDADES. Fogafin. Declaro que me ha sido suministrada la informaci\xF3n concerniente al seguro de dep\xF3sitos del Fondo de Garant\xEDas de Instituciones Financieras FOGAFIN, y que la misma est\xE1 a mi disposici\xF3n en la p\xE1gina web de LAS ENTIDADES. D\xE9bito autom\xE1tico. Autorizo a LAS ENTIDADES o a quien represente sus derechos u ostente en el futuro la calidad de acreedor hasta la cancelaci\xF3n total de la obligaci\xF3n, para debitar de la cuenta designada y de cualquier dep\xF3sito a mi nombre o de mi representada en LAS ENTIDADES, el valor total de las cuotas de amortizaci\xF3n, c\xE1nones, seguros, comisiones y dem\xE1s valores a mi cargo, de conformidad con las condiciones previamente acordadas. Compensaci\xF3n. Autorizo a LAS ENTIDADES o a quien represente sus derechos u ostente en el futuro la calidad de acreedor, en forma permanente e irrevocable, para compensar de cualquier dep\xF3sito a mi nombre o de mi representada, aun cuando ello genere sobregiro, las tarifas, comisiones, c\xE1nones, cuota (s) de amortizaci\xF3n a capital, intereses, impuestos, seguros, costos y gastos de cobranza judicial y extrajudicial y, dem\xE1s obligaciones a mi cargo por cualquier producto o servicio prestado por LAS ENTIDADES. Declaraci\xF3n de cambio, monetizaci\xF3n. Autorizo a Bancolombia S.A. a monetizar los giros recibidos a mi nombre desde el exterior en moneda extranjera que no correspondan a operaciones obligatoriamente canalizables y a suministrar al Banco de la Rep\xFAblica la informaci\xF3n que yo provea a Bancolombia S.A. sobre los datos m\xEDnimos de las operaciones de cambio por servicios, transferencias y otros conceptos (Declaraci\xF3n de Cambio), por cada operaci\xF3n que sea monetizada y negociada directamente por Bancolombia S.A.; igualmente, lo autorizo para aplicar dichos recursos al pago de las cuotas, c\xE1nones y dem\xE1s gastos asociados a todas las obligaciones que tenga con el Banco en general y, en especial, a mis obligaciones hipotecarias/leasing habitacional, con el mismo. Adicionalmente declaro que todos los giros recibidos y enviados desde y hacia el exterior corresponden a operaciones de cambio no obligatoriamente canalizables. Correspondencia. Autorizo que la correspondencia en general y los extractos me sean enviados a trav\xE9s de los medios virtuales, previamente habilitados e informados por LAS ENTIDADES. Declaramos conocer y aceptar que si deseamos recibirlos por otro medio, podemos solicitarlo a trav\xE9s de la sucursal vi